import React from 'react'
import mapboxgl from "mapbox-gl";

import projects from "../../data/landlines.json";


const ProjectComponent = ({map}) => {

    // projects.features.forEach((marker, index) => {
    //     console.log(marker)
    // })

    function addMarkers() {
        projects.features.forEach(function (marker, index) {
          const el = document.createElement("div");
          el.id = "marker-" + marker.properties.id;
          el.className = "markers-ll";
          el.innerHTML =
            `<div class="marker"><h4><span>` +
            marker.properties.alt +
            `</span></h4></div>`;

          new mapboxgl.Marker(el).setLngLat(marker.geometry.coordinates).addTo(map);

          el.addEventListener("click", function (e) {
          });
        });
      }

      if (map) {
        map.on("load", () => {
          addMarkers();
        });
      }


    return (
        <div>
           test 
        </div>
    )
}

export default ProjectComponent
